const styles = {
    border: "2px solid black",
    margin: "2px",
    backgroundColor: "wheat"
}
function ReminderSticker({children}){
    return(
        <div className = "ReminderSticker" style = {styles}>
            {children}
            <Label>Completed</Label>
            <input type = "checkbox" id = "completed-check"></input>
            <input type = "button" id = "delete-reminder">Delete</input>
        </div>
    )
}

export default ReminderSticker;
